pi_digits = ""

# Calculate the maximum valid starting index for a 4-digit slice
max_start_index = len(pi_digits) - 4

# Extract seeds ensuring we don't go out of bounds
seeds = [int(pi_digits[i:i+4]) for i in range(0, 128, 4)]

print(seeds)

# Convert list to set to remove any duplicates
unique_seeds = set(seeds)

# Check if there are duplicates by comparing lengths
if len(unique_seeds) != len(seeds):
    print("There are duplicates.")
else:
    print("There are no duplicates.")
    
    print(f"Total number of seeds: {len(seeds)}")